import asyncio

from master_captcha.master_captcha import CaptchaManager


async def main():
    m = CaptchaManager()
    # тюнить при желании:
    m.set_polling(poll_interval=1.5, status_timeout=90.0)
    m.set_retry(max_retries=2, retry_interval=1.0, backoff_factor=2.0)
    m.set_request(request_timeout=30.0, verify_ssl=False, proxy="http://127.0.0.1:8080")

    res = await m.capmonster.image_to_text(
        api_key="7c1235b907a6ecc43096bf058d47c05e",
        body_base64="",  # без переносов строк
        recognizingThreshold=70,  # 0..100
        case=True,  # чувствительность к регистру
        numeric=0,  # 1 — только цифры
        math=False,  # если капча — пример 2+6
        # capMonsterModule="yandex",             # если нужен конкретный модуль
    )



asyncio.run(main())
